ail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/uNS532Lblh8\/maxresdefault.jpg\",\"width\":1280,\"height\":720}]},\"embed\":{\"iframeUrl\":\"https:\/\/www.youtube.com\/embed\/uNS532Lblh8\",\"flashUrl\":\"http:\/\/www.youtube.com\/v\/uNS532Lblh8?version=3\\u0026autohide=1\",\"width\":1280,\"height\":720,\"flashSecureUrl\":\"https:\/\/www.youtube.com\/v\/uNS532Lblh8?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"The 13 Year Stomach Ache: Gastrointestinal Stromal Tumor | Medical Documentary | Reel Truth\"},\"description\":{\"simpleText\":\"Sixteen-year-old Jennifer Fagenson comes down with altitude sickness and takes aspirin to help relieve it, but unfortunately, this lands her in the hospital. Thinking she may be allergic to the aspirin, she stops taking it, but she deals with excruciating stomaches, internal bleeding, indigestion, backaches, and diarrhoea for the next13 years. It turns out that Jennifer actually has a gastrointestinal stromal tumor (GIST). Joyce Gonzales, a healthy mother of two, suddenly has pain in her hand and forearm that spreads to her other arm and weakness in her hands. She is initially diagnosed with carpal tunnel syndrome, then chronic pain syndrome, but the pain is too much for her, and she also finds out she has brain lesions. After being dismissed so much, Joyce finds out that she has a hereditary form of cavernous angioma.\\n\\nEvery year, millions of Americans fall prey to real-life medical mysteries ailments that go undiagnosed or misdiagnosed for years. Their lives are thrown into turmoil as medical professionals struggle to understand their baffling conditions. Mystery diagnosis tells their stories. Through interviews and dramatic recreations, each medical mystery is recounted in vivid detail. Symptoms emerge, specialists are called in, but still the daily struggle continues. And then one day, because of a patients relentless pursuit of an accurate diagnosis, or a forward thinking doctor, the problem is solved and a true diagnosis given.\\n\\nSubscribe here for more full length documentaries: https:\/\/www.youtube.com\/channel\/UCFrO-dKhooOuTtix5dia2_g?sub_confirmation=1\\n\\nWelcome to Reel Truth the home of amazing documentaries! Here you will find full episode documentaries and documentary series, covering true crime, medical, science and more.\"},\"lengthSeconds\":\"2603\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/channel\/UCFrO-dKhooOuTtix5dia2_g\",\"externalChannelId\":\"UCFrO-dKhooOuTtix5dia2_g\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"PK\",\"PL\",\"PM\",\"PN\",\"PS\",\"PT\",\"PW\",\"PY\",\"QA\",\"RE\",\"RO\",\"RS\",\"RU\",\"RW\",\"SA\",\"SB\",\"SC\",\"SD\",\"SE\",\"SG\",\"SH\",\"SI\",\"SJ\",\"SK\",\"SL\",\"SM\",\"SN\",\"SO\",\"SR\",\"SS\",\"ST\",\"SV\",\"SX\",\"SY\",\" y to real-life medical mysteries ailments that go undiagnosed or misdiagnosed for years. Their lives are thrown into turmoil as medical professionals struggle to understand their baffling conditions. Mystery diagnosis tells their stories. Through interviews and dramatic recreations, each medical mystery is recounted in vivid detail. Symptoms emerge, specialists are called in, but still the daily struggle continues. And then one day, because of a patients relentless pursuit of an accurate diagnosis, or a forward thinking doctor, the problem is solved and a true diagnosis given.\n\nSubscribe here for more full length documentaries: "},{"text":"https://www.youtube.com/channel/UCFrO...","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIu8G1v5uT6gIVVBngCh0hqgdBSJ-s7pb2u67quAE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/channel/UCFrO-dKhooOuTtix5dia2_g?sub_confirmation=1","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/channel/UCFrO-dKhooOuTtix5dia2_g?sub_confirmation=1","nofollow":true}}},{"text":"\n\nWelcome to Reel Truth the home of amazing documentaries! Here you will find full episode documentaries and documentary series, covering true crime, medical, science and more."}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJUBEJsrIhMIu8G1v5uT6gIVVBngCh0hqgdB","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJYBEP2GBCITCLvBtb-bk-oCFVQZ4AodIaoHQTIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url"
